tables.table_schema:
CREATE TABLE labeled_images (
    id INT PRIMARY KEY,
    image_data BYTEA,
    label VARCHAR(50)
);

CREATE TABLE neural_networks (
    id INT PRIMARY KEY,
    network_name VARCHAR(100),
    layers INT,
    activation_function VARCHAR(50)
);

CREATE TABLE ImageData (
    id INT PRIMARY KEY,
    image_data BYTEA,
    label VARCHAR(255)
);

CREATE TABLE ModelData (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(255),
    model_architecture TEXT
);

CREATE TABLE images (
  id SERIAL PRIMARY KEY,
  image_data BYTEA,
  label TEXT
);

CREATE TABLE labels (
  label_id SERIAL PRIMARY KEY,
  label_name TEXT
);

CREATE TABLE images (
    image_id INT PRIMARY KEY,
    image_data BYTES,
    label TEXT
);

CREATE TABLE labels (
    label_id INT PRIMARY KEY,
    label_name TEXT
);

CREATE TABLE model_predictions (
    image_id INT,
    model_id TEXT,
    prediction_score FLOAT,
    FOREIGN KEY (image_id) REFERENCES images(image_id)
);
